import React, {Component, Fragment} from "react";
import {Link} from "react-router-dom";
import "./CafeLsit.css";

class CafeList extends React.Component {
  render() {
    return(
      <div id="bar">
        <form class="searchBar" action="action_page.php">
            <input type="search" placeholder="Search.." name="search"/>
            <input type="submit" name="selectBtn" value="조회"/>

          
          <div id="recommend">
                  <div class="item"><span class="text"></span></div>
                  <div class="item">스타벅스 <span class="text"></span></div>
                  <div class="item">이디야<span class="text"></span></div>
              </div>
      </form>
  </div>
    );
  }
}

export default CafeList;
